import React, { Component } from 'react';

class Board extends Component {
    render() {
        console.log('TestList render');
        var lists = [];
        var tests = this.props.tests;
        var mode = this.props.mode;
        var i = 0;
        while (i < tests.length) {
            if(tests[i].status === "yes"){
                lists.push(
                    <li key={tests[i].id} className="test">
                        <div>
                            <a href={"/test.html/" + tests[i].id}
                                data-id={tests[i].id}
                                onClick={function (e) {
                                    e.preventDefault();
                                }.bind(this)}
                            >{tests[i].title}</a><br />
                            {tests[i].date}
                        </div>
                        <div>
                            {tests[i].correct} / {tests[i].all}
                            <div class="flex">
                                <button>결과보기</button>
                                <button>재시험보기</button>
                            </div>
                        </div>
                    </li>)
                i = i + 1;
            } else {
                lists.push(
                    <li key={tests[i].id} className="test">
                        <div>
                            {tests[i].title}<br />
                            {tests[i].date}
                        </div>
                        <a href={"/test.html/" + tests[i].id}
                                data-id={tests[i].id}
                                onClick={function (e) {
                                    e.preventDefault();
                                }.bind(this)}
                            >
                            시험시작하기
                        </a>
                    </li>)
                i = i + 1;
            }
        }
        if (mode === "testCreate") {
            return (
                <div>
                    새로운 테스트 만들기
                    <input type="file">테스트 생성을 위한 학습자료를 올려주세요</input>
                    <div>
                        <a href="#"
                            onClick={function (e) {
                                this.props.onChangePageMypage();
                            }.bind(this)}>
                            완료
                            </a>
                    </div>
                </div>
            );
        } else if (mode === "mypage") {
            return (
                <div className="flex">
                    <div className="profile">
                        <div className="profile-box">
                            <img className="profile-image" src={this.props.profimg} />
                        </div>
                        <h2> User </h2>
                        <div className="user_status">
                            <h6 text-align="middle">완료한 테스트
                            진행중인 테스트</h6>
                        </div>
                    </div>
                    <div>
                        <div className="flex">
                            <div>
                                <h1> 나의 테스트 </h1>
                            </div>
                            <div>
                                <a href="#"
                                    onClick={function (e) {
                                        this.props.onChangePageCreate();
                                    }.bind(this)}>
                                    Click me
                            </a>
                            </div>
                        </div>
                        <ul>
                            {lists}
                        </ul>
                    </div>

                </div>
            );
        }
    }
}

export default Board;
